import React, { Component } from 'react';

class SearchSong extends Component{
    componentDidMount(){
        const { name } = this.props.match.params;
        this.state({
            value:name
        })
    }
    render(){
        return(
            <div>{this.state.name}</div>
        )
    }
}
export default SearchSong;
